/* Cambria Bold font converted for jsPDF */
import { jsPDF } from "jspdf";

(function (jsPDFAPI) {
  var callAddFont = function () {
    this.addFileToVFS("Cambria-Bold.ttf", "");
    this.addFont("Cambria-Bold.ttf", "Cambria", "bold");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
